    @Test
    public void entradaDoEstagioDispensavel() {
        inicioExecucao = new DateTime(2016, 12, 23, 0, 0, 0);
        controlador = getControlador();
        Motor motor = new Motor(controlador, inicioExecucao, this);

        Anel anel = getAnel(1);
        Pair<Integer, TipoDetector> detector = getDetector(anel, 1);

        avancarSegundos(motor, 196);
        motor.onEvento(new EventoMotor(inicioExecucao.plusSeconds(196), TipoEvento.ACIONAMENTO_DETECTOR_PEDESTRE, detector, 1));
        avancarSegundos(motor, 500);

        int anel1 = 1;
        int offsetEstagio = 205;
        assertEquals("E2", 2, listaEstagios.get(inicioExecucao.plusSeconds(offsetEstagio)).get(anel1).getEstagioPlano().getPosicao().intValue());
        verificaGruposSemaforicos(offsetEstagio, new GrupoCheck(anel1, 1, 0, 3000, EstadoGrupoSemaforico.AMARELO));
        verificaGruposSemaforicos(offsetEstagio, new GrupoCheck(anel1, 1, 3000, 5000, EstadoGrupoSemaforico.VERMELHO_LIMPEZA));
        verificaGruposSemaforicos(offsetEstagio, new GrupoCheck(anel1, 1, 5000, 10000, EstadoGrupoSemaforico.VERMELHO));

        verificaGruposSemaforicos(offsetEstagio, new GrupoCheck(anel1, 2, 0, 5000, EstadoGrupoSemaforico.VERMELHO));
        verificaGruposSemaforicos(offsetEstagio, new GrupoCheck(anel1, 2, 5000, 10000, EstadoGrupoSemaforico.VERDE));

        verificaGruposSemaforicos(offsetEstagio, new GrupoCheck(anel1, 3, 0, 10000, EstadoGrupoSemaforico.VERMELHO));

        verificaGruposSemaforicos(offsetEstagio, new GrupoCheck(anel1, 4, 0, 10000, EstadoGrupoSemaforico.VERDE));

        verificaGruposSemaforicos(offsetEstagio, new GrupoCheck(anel1, 5, 0, 5000, EstadoGrupoSemaforico.VERMELHO));
        verificaGruposSemaforicos(offsetEstagio, new GrupoCheck(anel1, 5, 5000, 10000, EstadoGrupoSemaforico.VERDE));

        verificaGruposSemaforicos(offsetEstagio, new GrupoCheck(anel1, 6, 0, 10000, EstadoGrupoSemaforico.VERMELHO));

        verificaGruposSemaforicos(offsetEstagio, new GrupoCheck(anel1, 7, 0, 5000, EstadoGrupoSemaforico.VERDE));
        verificaGruposSemaforicos(offsetEstagio, new GrupoCheck(anel1, 7, 5000, 8000, EstadoGrupoSemaforico.AMARELO));
        verificaGruposSemaforicos(offsetEstagio, new GrupoCheck(anel1, 7, 8000, 10000, EstadoGrupoSemaforico.VERMELHO_LIMPEZA));
    }

